import React from "react";
import mcqData from "./data";
import "./mcq.css";
const QueAns = () => {
  return (
    <>
      <div className="mcq">
        <div className="header">Mcq Questions</div>
        {mcqData.map((elem) => {
          let { id, que, ans } = elem;
          return (
            <>
              <div>
                {id}
                {que}
                {ans}
              </div>
            </>
          );
        })}
      </div>
    </>
  );
};

export default QueAns;
